s:11:"CEvOoZnJMrm";}i:210;a:1:{s:12:"created_time";i:1599272592;}i:211;a:1:{s:7:"caption";s:1698:"Ahhh yes, #SeaSlugtember Day 4!

Today's featured sea slug doesn't really LOOK like a slug, but they're considered free-swimming slugs.

Introducing the SEA ANGEL!

Clade Gymnosomata is a very large group - a clade is a group of organisms with a common ancestor. There are six different families of sea angels, but I'll spare you the prolonged speech on taxonomy - suffice to say they are precious beans.

Sea Angels are found all over the world, in arctic and tropical waters, and everything in between!

They are mostly incredibly smol, the largest reaching a scant 5 cm.

They are carnivores, and primarily eat sea butterflies (which are another incredibly awesome looking critter!)

In addition to swimming very fast, Sea Angels can also leave sticky mucus trails that catch sea butterflies like a spiderweb!

They are protandrous hermaphrodites, starting out as male and becoming female with age. When they mate, they... turn their bits inside out. How's that for foreplay? 

And they'll have lunch while they're doing it. Multi-tasking masters.

While sea angels themselves aren't directly threatened, the continuing acidification of our oceans affects sea butterflies (and other mollusks, as it's eroding their shells and in turn eroding the entire food web). 

You can find greeting cards, decals, and mugs of these delicate and beautiful little creatures at:

